import React, { Component } from 'react';
import './styles/styles.css';
import Navbar from './Navbar';
import Logo from './Logo';

class Header extends Component {
    render() {
        return (
            <header>
                <Navbar />
                <Logo />
            </header>
        )
    }
}

export default Header;
